import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import routes from '../routes'

export default function RouteConfigExample() {
  return (
    <Router>
      <div>
        <ul>
          <li>
            <Link to="/career-mapper">CM</Link>
          </li>
          <li>
            <Link to="/career-finder">CF</Link>
          </li>
        </ul>

        <Switch>
          {routes.map((route) => (
            <Route
            path={route.path}
            render={props => (
              <route.component {...props} routes={route.routes} />
            )}
          />
          ))}
        </Switch>
      </div>
    </Router>
  );
}

function CareerMapper() {
  return <h2>CMY</h2>;
}

function CareerFinder({ routes }) {
  return <h2>CFY</h2>;
}
